SAUNI ‘TALAVALU LAITI’ TAU LE TAUA I LE APIA PARK O ananafi na tuuvaa ese atu ai le au fili a tama aoga i lalo o le 19 tausaga le matutua, le Talavalu Laiti, mo le tauina o le taua i le taamilosaga a le Oceania U19’s Championship, lea o le a tali malo ai Samoa mo le lua vaiaso i le malae o le Apia Park Stadium. E ui o le faalua ai lea ona ofi atu se au fili a tamaiti aoga e i lalo o le 19 tausaga le matutua mai si o tatou atunuu nei, e tausinio i taamiloaga a le Pasefika, e le o avea lea ma itu 
..........
u ma lou fesoasoani, o le a maualuga se tulaga e oo i ai le taumafaiga a le tatou au fili i lenei faamoemoe,” o le saunoaga lea Chang. O le toatele o tamaiti o le au na soifua mai i Amerika Samoa nei, sei vagana ai se vaega toaititi e malaga mai fafo, e pei o le alii mai Tonga e toafa, toatolu mai Upolu ma le toatasi o se alii Initia/Samoa. E 6 au o lo o auai i lenei taamilosaga lea e pei ona vaevaeina ai i pool e lua. O au e 6 e aofia ai Samoa; Amerika Samoa ma Vanuatu i le Pool A, ae o Tonga;
